import Header from "../Header/Header";

function HomePage(props) {
  console.log(props.text);
  return (
    <>
      <section className="advertising">
        <div className="advertising__container _container">
          <Header
            text={props.text.header}
            languages={props.languages}
            curLang={props.currLang}
            setLanguage={props.setLanguage}
            links={props.links}
          ></Header>
        </div>
        <section className="logotype">
        <div class="logotype__container _container" style={ {backgroundImage: "url(./logo-p-big.png)"} }>
          <h2 className="logotype__title">{props.text.logotype.title}</h2>
        </div>
      </section>
      </section>

    </>
  );
}

export default HomePage;
